import "./AccountNavbar.css";
import { Link } from "react-router-dom";

import Logo from "../../../assets/icons/bemi.png";

const AccountNavbar = () => {
  return (
    <nav className="navbar">
      <div className="container">
        <Link to="/" className="logo">
          <img src={Logo} alt="" />
        </Link>
      </div>
    </nav>
  );
};

export default AccountNavbar;
